import React from 'react';
import './style.css';
import {GoogleMap, withScriptsjs, withGoogleMap} from "react-google-maps";

function Map(){
    return (<GoogleMap 
    defaultZoom={10} 
    defaultCenter={{lat: -7.214807, lng: -35.908444}}
        />
    );
}

const WrappedMap = withScriptsjs(withGoogleMap(Map));


function App() {
  return (
    <div className="geral-container">
        <div className="menu">
            <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">Lojas virtuais</a></li>
                <li><a href="#">Objetivo</a></li>
                <li><a href="#">Ongs</a></li>
                <li><a href="#">Contato</a></li>
            </ul>
        </div>
        <div>
            <WrappedMap
                GoogleMapURL={"https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places"} 
            />
        </div>


    </div>
  );
}

export default App;
